I am using OnnxRuntime to inference a model created via ML.NET using LightGBM for binary classification based on tabular data and saved using ConvertToOnnx.  I need to use OnnxRuntime vs native ML.NET for inferencing to support an older version of .NET Framework but am attempting to get to work on .NET Core 2.2 for now.

The model uses a binary Label named "HProf" that takes the value of 0 or 1 and Features comprised of 96 float values.  

I have been referencing this onnxruntime example [here](https://github.com/microsoft/onnxruntime/blob/master/csharp/sample/Microsoft.ML.OnnxRuntime.InferenceSample/Program.cs) but have not been able to get it to work perhaps due to my lack of understanding of how best to use 1D Tensors in this context.  As you can see in the code below, I am attempting to inference one sample instance and it seems to require a dummy label value but I am unclear on this requirement.

```csharp
